public class InnerApplicationComponentMonitoringSettingFactory(Action<Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting> factoryAction = null) : SubResourceFactory<Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting>
{

    internal InnerApplicationComponentConfigurationFactory CustomComponentConfigurationFactory { get; set; }

    internal InnerApplicationComponentConfigurationFactory DefaultOverwriteComponentConfigurationFactory { get; set; }

    protected override Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting Create()
    {
        var componentMonitoringSettingResult = CreateComponentMonitoringSetting();
        factoryAction?.Invoke(componentMonitoringSettingResult);

        return componentMonitoringSettingResult;
    }

    private Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting CreateComponentMonitoringSetting()
    {
        var componentMonitoringSettingResult = new Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting();

        return componentMonitoringSettingResult;
    }
    public override void CreateChildren(Humidifier.ApplicationInsights.ApplicationTypes.ComponentMonitoringSetting result)
    {
        base.CreateChildren(result);

        result.CustomComponentConfiguration ??= CustomComponentConfigurationFactory?.Build();
        result.DefaultOverwriteComponentConfiguration ??= DefaultOverwriteComponentConfigurationFactory?.Build();
    }

} // End Of Class

